function ToggleButton() {
  return (
    <div class="max-h-full max-w-full flex items-center">
      <div class="flex items-center p-1 h-10 w-20 rounded-full bg-gray-300">
          <div class="shadow-md h-8 w-8 rounded-full bg-white"></div>
